CREATE TABLE "daty" (
	"nr_notowania"	INTEGER UNIQUE,
	"dzien"	INTEGER,
	"miesiac"	INTEGER,
	"rok"	INTEGER,
	"data"	TEXT,
	PRIMARY KEY("nr_notowania")
);




CREATE TABLE "notowania" (
	"id"	INTEGER NOT NULL UNIQUE,
	"nr_notowania"	INTEGER,
	"pozycja"	INTEGER,
	"artysta"	TEXT,
	"tytul"	TEXT,
	FOREIGN KEY("nr_notowania") REFERENCES daty (nr_notowania),
	PRIMARY KEY("id")
);

